import React from 'react';

import CustomExpandedBox from '../customExpandedBox';
/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */

export default function ExtendedTableRow(props){  
    // console.log("INDEX: ",props.index); 
    // console.log("ID: ",props.id);
    

    console.log("THIS USER DATA",props.thisUserData);
    let accessData = props.thisUserData.currentAccess; 
    let addressData = props.thisUserData.currentAddr; 
    let jobData = props.thisUserData.currentAccess; 
    let productData = props.thisUserData.currentAccess; 

    console.log("Access Data: ",accessData);
    console.log("Access Data: ",addressData);
    console.log("Access Data: ",jobData);
    console.log("Access Data: ",productData);

    return (   
        <div style={style.container}>
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Acesso do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Rede",fieldKey: "currentAccess"}]}
            fieldValues = {{}}
            userInfo = {props.thisUserData}

            />
               
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Endereço do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Endereco",fieldKey: "currentAddress"}]}
            fieldValues = {{}}
            userId = {props.id}
            userIndex = {props.index}
            userInfo = {props.thisUserData}



            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Emprego do Usuário"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Emprego",fieldKey: "currentJob"}]}
            fieldValues = {{}}
            userId = {props.id}
            userInfo = {props.thisUserData}




            /> 
 
            <CustomExpandedBox
            boxWidth="20%"
            bgColor= "#ffb5bc"
            boxTitle= "Produto comprado"
            boxHeight = "cacl(100% / 4)"
            fieldsList = {[{label: "Produto",fieldKey: "productsBuyed"}]}
            fieldValues = {{}}
            userId = {props.id}
            userInfo = {props.thisUserData}



            /> 
            
        </div>
    )
}


const style = {
    container: {
        width: "100%",
        height: "100%",
        flexDirection: "row",
        alignContent: "center"
    }
    

};
